// import logo from './logo.svg';
import './App.css';
import {Routes, Route} from 'react-router-dom'
import Home from "./Components/Home/Home"


function App() {
  return (
    <div>
      <Routes>
       <Route path="/" element={<Home/>}/>
       <Route path="/details/:rName" element={<Restaurants/>}/>
      </Routes>

    </div>
  );
}

export default App;
